ControlPropertyState.AutoRuleBindingString:
If(
    " " in Trim(txt_person_forename.Text),
    Set(
        gblSplitForename,
        Split(
            txt_person_forename.Text,
            " "
        )
    );
    Set(
        NEREsult,
        PersonSearchPNCResults.Run(
            Upper(
                Trim(
                    Concatenate(
                        Txt_person_surname.Text,
                        "/",
                        Upper(
                            Left(
                                Concat(
                                    gblSplitForename,
                                    Result & "/"
                                ),
                                Len(
                                    Concat(
                                        gblSplitForename,
                                        Result & "/"
                                    )
                                ) - 1
                            )
                        )
                    )
                )
            )
        )
    );
    Set(
        NeResult1,
        First(NEREsult).Records
    ),
    Set(
        NEREsult,
        PersonSearchPNCResults.Run(
            Upper(
                Trim(
                    Concatenate(
                        Txt_person_surname.Text,
                        "/",
                        txt_person_forename.Text
                    )
                )
            )
        )
    );
    Set(
        NeResult1,
        First(NEREsult).Records
    )
);
If(
    IsBlank(First(NeResult1).Record),
    Navigate(
        Screen_PNC,
        Fade
    ),
    IsEmpty(NeResult1),
    Notify(
        "No Results Found",
        NotificationType.Error
    ),
    Navigate(Screen_PNC_Possibles)
);

